    %% MAIN FUNCTIONS
    % ==================================================================================================================================================
    methods (Static)
        
        function color = getColor(color_id, n_col, map_name, mode)
            % get a color at a specific id of the colormap
            %
            % INPUT
            %   color_id    id within the cmap matrix of the colors to extract
            %   n_col       number of colors requested for a specific colormap
            %   map_name    name of colormap to be used (default = 'pltd')
            %   mode        mode of color request
            %                == 'repeat'  -> the sequence of colors is repeated 
            %                                after the n_col (default)
            %                == 'linear'  -> color_id is <= n_col
            % SYNTAX:
            %   color = Cmap.getColor(color_id, <n_col>, <map_name = 'pltd'>, <mode = 'repeat'>);            
            %
            % EXAMPLE
            %   color = Cmap.getColor(1 : 19, 25, 'linspaced');
            %   figure; 
            %   for i = 1:size(color, 1)
            %       plot(i + 0.1 * randn(100, 1), '.-', 'Color', color(i, :), 'LineWidth', 3);
            %       hold on;
            %   end
            %
            
            if (nargin < 1) || isempty(color_id)
                color = [];
            else
                % Define default colormap to pltd 
                % (default sequence of colors of MATLAB plots)
                if nargin < 3 || isempty(map_name)
                    map_name = 'pltd';
                end
                
                % if mode is not specified use 'repeat'
                if nargin < 4 || isempty(mode)
                    mode = 'repeat';
                end
                
                if nargin == 1 || isempty(n_col)
                    % if the number of colors is not specified use the default size of the colormaps
                    if nargin < 4 || isempty(mode)
                        cmap = Cmap.get(map_name);
                    else
                        cmap = Cmap.get(map_name, max(color_id));
                    end
                else
                    cmap = Cmap.get(map_name, n_col);
                end
                
                n_col = size(cmap, 1);
                switch mode
                    case {'linear'}
                        color = cmap(min(color_id, n_col), :);
                    otherwise
                        color = zeros(numel(color_id),3);
                        for c = 1 : numel(color_id)
                            color(c, :) = cmap(mod(color_id(c) - 1, n_col) + 1, :);
                        end
                end
            end
        end
        
        function [cmap, found] = get(map_name, n_col, flag_smooth)
            % Getter function, get any of the colormap stored / implemented 
            % into this class.
            % To show all the implemented colormaps use any of the "show" methods
            %
            % INPUT
            %   map_name    name of the colormap function
            %   n_col       number of color requested
            %               could be empty, in this case the default number of color is provided
            %   flag_smooth if it is true (default choice) smooths the colormap in out,
            %               requires goGPS splinerMat function
            %
            % SYNTAX
            %   [cmap, found] = Cmap.get(map_name, <n_col>, <flag_smooth = true>)
            %
            if nargin < 3 || isempty(flag_smooth)
                flag_smooth = false;
            end
                        
            % Set default to parula
            tmp = strfind(Cmap.MPL_MAPS, map_name); 
            id = find((~cellfun(@isempty, tmp)) & (cellfun(@length, Cmap.MPL_MAPS) == numel(map_name)));
            found = ~isempty(id);
            if found
                source_cmap = Cmap.MPL_CMAP(:, :, id);
                
                % Do not smooth flag or prism colormaps
                if strcmp(map_name, 'flag') || strcmp(map_name, 'prism')
                    id_ko = [false; (diff(int64(uint32(source_cmap(:,1)) * 2^16 + uint32(source_cmap(:,2)) * 2^8 + uint32(source_cmap(:,3)))) == 0)];
                    source_cmap(id_ko, :) = [];
                    flag_smooth = false;
                end
                
                % Find qualitative maps that needs to be interpolated with nearest neighbour
                tmp = strfind(Cmap.QUALITATIVE, map_name);
                is_qualitative = any(~cellfun(@isempty, tmp));
                if is_qualitative
                    method = 'nearest';
                    % Get only unique colors present in the cmaps
                    [~, id_unique] = unique(uint32(source_cmap(:,1)) * 2^16 + uint32(source_cmap(:,2)) * 2^8 + uint32(source_cmap(:,3)));
                    source_cmap = double(source_cmap(sort(id_unique), :)) / 256;
                else
                    source_cmap = double(source_cmap) / 256;
                    method = 'linear';
                    if flag_smooth
                        source_cmap = Cmap.smoothMap(source_cmap);
                    end
                end
                source_n_col = size(source_cmap,1);
                
                if nargin < 2 || isempty(n_col)
                    cmap = source_cmap;
                else
                    cmap = zeros(n_col, 3);
                    c_pos = (((0 : (n_col - 1)) / (n_col)) * (source_n_col - 1)) + 1;
                    for c = 1 : 3
                        cmap(:, c) = interp1(1 : source_n_col, source_cmap(:, c), c_pos, method);
                    end
                end
            else
                switch map_name
                    case 'c51'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.c51();
                        else
                            cmap = Cmap.c51(n_col, flag_smooth);
                        end
                        found = true;
                    case 'noaaRain'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.noaaRain();
                        else
                            cmap = Cmap.noaaRain(n_col, flag_smooth);
                        end
                        found = true;                        
                    case 'gat'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.gat(1024, false);
                        else
                            cmap = Cmap.gat(n_col, false);
                        end
                        found = true;
                    case 'BuRd'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.BuRd(1024);
                        else
                            cmap = Cmap.BuRd(n_col);
                        end
                        found = true;
                    case 'linspaced'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.linspaced();
                        else
                            cmap = Cmap.linspaced(n_col);
                        end
                        found = true;
                    case 'gat2'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.gat2();
                        else
                            cmap = Cmap.gat2(n_col);
                        end
                        found = true;
                    case 'adaptiveTerrain'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.adaptiveTerrain([-1000 3500]);
                        else
                            cmap = Cmap.adaptiveTerrain([-1000 3500], n_col);
                        end
                        found = true;
                    case 'pltd'
                        if nargin == 1 || isempty(n_col)
                            cmap = Cmap.pltd();
                        else
                            cmap = Cmap.pltd(n_col);
                        end
                        found = true;
                    case 'parula'
                        if nargin == 1 || isempty(n_col)
                            cmap = parula();
                        else
                            cmap = parula(n_col);
                        end
                        found = true;
                end
            end
            
            if ~found
                if nargin == 1 || isempty(n_col)
                    cmap = parula();
                else
                    cmap = parula(n_col);
                end
                fprintf('Cmap %s not found\n', map_name);            
            end
        end
                
        function smooth_cmap = smoothMap(cmap)
            % Given a colormap smooth it with splines in the RGB color space
            % This function can be triggered automatically by the get function
            %
            % The function requires splinerMat.m
            %
            % SYNTAX
            %   smooth_cmap = Cmap.smoothMap(cmap)
            %
            % SEE ALSO
            %   splinerMat
            %
            cmap = double(cmap);
            try
                smooth_cmap = cmap;
                for c = 1 : 3
                    smooth_cmap(:,c) = max(0, min(1, splinerMat([], cmap(:,c), size(cmap,1) / 30)));
                end
            catch
                % The only reason this exception could be triggered is that
                % splinerMat is not in matlab path -> no smoothing
            end
        end
        
        function data = apply(data, cmap, clim, nan_col)
            % apply a colormap;
            %
            % SYNTAX
            %   data_out = Cmap.apply(data, cmap, clim, <nan_col>)
            %
            % EXAMPLE
            %   data_out = Cmap.apply(data, Cmap.get('RdBu'), minMax(data(:)), [0, 0, 0]);
            
            inan = isnan(data);
            data = data - clim(1); data = min(1, max(0, data./diff(clim)));
            id_col = serialize(round(data * (size(cmap,1) -1)) + 1);
            if nargin >= 3 && numel(nan_col) == 3
                cmap = [cmap; nan_col];
                id_col(inan) = size(cmap, 1);
            else
                id_col(inan) = 1;
            end
            data = reshape([cmap(id_col, 1); cmap(id_col, 2); cmap(id_col, 3)], size(data, 1), size(data,2) , 3);
        end
    end
    
