    % ==================================================================================================================================================
    methods (Static)   
        function cmap = diverging(color1_rgb, color2_rgb, n_col)
            % Create a diverging colormap from two colors
            % 
            % INPUT
            %   color1_rgb  as RGB [0 1]
            %   color1_rgb  as RGB [0 1]
            %   n_col       number of colors
            %
            % SYNTAX
            %   cmap = Cmap.diverging(color1_rgb, color2_rgb, n_col)
            n_col_half = floor(n_col/2);
            
            color1_rgb = repmat(color1_rgb, n_col_half, 1);
            color2_rgb = repmat(color2_rgb, n_col_half, 1);
            
            for c = 1:3
                step = (1 - color1_rgb(1, c)) /  (n_col_half - 1);
                color1_rgb(:, c) = color1_rgb(1, c) : step : 1;
                
                step = (1 - color2_rgb(1, c)) /  (n_col_half - 1);
                color2_rgb(:, c) = fliplr(color2_rgb(1, c) : step : 1);
            end
            if n_col_half * 2 < n_col
                cmap = [color1_rgb; [1 1 1]; color2_rgb];
            else
                cmap = [color1_rgb; color2_rgb];
            end
        end
        
        function cmap = BuRd(n_col)
            % Diverging Blue Red colormap
            %
            % SYNTAX
            %   cmap = Cmap.BuRd(n_col)
                
            c1 = [52 99 123]  ./ 255;
            c2 = [218, 80, 69] ./ 255;
            cmap = Cmap.diverging(c1, c2, n_col);
        end
        
        function cmap = pltd(n_col)
            % plot default MATLAB sequence (7 colors)
            % 
            % INPUT
            %   n_col           number of colors (default 7)
            %
            % SYNTAX
            %   cmap = Cmap.pltd(n_col)
            %

            source_cmap = Cmap.COLOR_ORDER;
            source_n_col = size(source_cmap, 1);
            method = 'linear';
            
            if nargin < 1 || isempty(n_col)
                cmap = source_cmap;
            else
                if n_col <= source_n_col
                    % do not interpolate, just extract
                    cmap = source_cmap(1 : n_col, :);
                else
                    cmap = zeros(n_col, 3);
                    c_pos = (((0 : (n_col - 1)) / (n_col)) * (source_n_col - 1)) + 1;
                    for c = 1 : 3
                        cmap(:, c) = interp1(1 : source_n_col, source_cmap(:, c), c_pos, method);
                    end
                end
            end            
        end

        function cmap = c51(n_col, flag_smooth)
            % c51 it's a colormap for rain precipitations
            % the first element of the map is always black
            %
            % INPUT
            %   n_col           number of colors (default 51)
            %   flag_smooth     flag to smooth the colormap
            %                   (it does a little difference for this map)
            %
            % SYNTAX
            %   cmap = Cmap.c51(n_col, flag_smooth)
            %
            if nargin < 2 || isempty(flag_smooth)
                flag_smooth = false;
            end
            source_cmap = Cmap.CMAP_51(2 : end, :);
            source_n_col = size(source_cmap, 1);
            method = 'linear';
            if flag_smooth && ~((nargin < 1) || isempty(n_col) || (n_col == 51))
                source_cmap = Cmap.smoothMap(source_cmap);
            end
            
            if nargin < 1 || isempty(n_col)
                cmap = source_cmap;
            else
                n_col = n_col - 1;
                cmap = zeros(n_col, 3);
                c_pos = (((0 : (n_col - 1)) / (n_col)) * (source_n_col - 1)) + 1;
                for c = 1 : 3
                    cmap(:, c) = interp1(1 : source_n_col, source_cmap(:, c), c_pos, method);
                end
            end
            
            cmap = [0, 0, 0; cmap];
        end

        function cmap = noaaRain(n_col, flag_smooth)
            % NOAA RAIN it's a colormap for rain precipitations
            %
            % INPUT
            %   n_col           number of colors (default 709) better to keep it
            %   flag_smooth     flag to smooth the colormap
            %
            % SYNTAX
            %   cmap = Cmap.noaaRain(n_col, flag_smooth)
            %
            if nargin < 2 || isempty(flag_smooth)
                flag_smooth = false;
            end
            source_cmap = double(Cmap.NOAA_RAIN(1 : end, :)) / 256;
            source_cmap(655:665,:) = []; % remove white jump (I don't like it)
            source_n_col = size(source_cmap, 1);
            method = 'linear';
            if flag_smooth && ~((nargin < 1) || isempty(n_col) || (n_col == 51))
                source_cmap = Cmap.smoothMap(source_cmap);
            end
            
            if nargin < 1 || isempty(n_col) || n_col == source_n_col
                cmap = source_cmap;
            else
                n_col = n_col - 1;
                cmap = zeros(n_col, 3);
                c_pos = (((0 : (n_col - 1)) / (n_col)) * (source_n_col - 1)) + 1;
                for c = 1 : 3
                    cmap(:, c) = interp1(1 : source_n_col, source_cmap(:, c), c_pos, method);
                end
            end            
        end
        
        function cmap = gat(n_col, flag_zero_center, flag_use_white)
            % gat colormap build for enhancing  differences around zero have to be highlighted
            % 
            % INPUT
            %   n_col               number of colors
            %   flag_zero_center    when true and use caxis to center white to the zero of the axes
            %   flag_use_white      use white as a central value (useful for enhancing differences
            %
            % SYNTAX
            %   cmap = Cmap.gat(n_col, <flag_zero_center = true>, <flag_use_white  = true>)
            %
            
            if nargin < 1
                n_col = 255;
            end
            if nargin < 2
                flag_zero_center = 1;
            end
            if nargin < 3
                flag_use_white  = 1;
            end
            
            
            clim = caxis();
            if (clim(1)>0 || clim(2)<0)
                flag_zero_center = 0;
            end
            if flag_zero_center
                center = round(clim(2)*n_col/(clim(2)-clim(1)));
                N = 2*center;
            else
                N = n_col;
                center = round(n_col/2);
            end
            
            if n_col == 0
                cmap = [];
                return
            end
            
            try
                L = ones(n_col,1)*100;
                a = ones(n_col,1)*0;
                b = ones(n_col,1)*0;
                
                % RED     100  128  128
                % VIOLET  100  128 -128
                % GREEN     x -128  128
                % BLUE      x -128 -128
                
                % BLACK => RED => GREEN =>  BLUE => VIOLET
                
                % BLACK to RED
                n_val = floor(N*5/32);
                Lab1 = [20 20 10];
                Lab2 = [40 100 128];
                step = 1/(n_val-1);
                L(1:n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                a(1:n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                b(1:n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                s = n_val;
                
                % RED to YELLOW
                n_val = floor(N*6/32);
                Lab1 = [40 100 120];
                Lab2 = [100 -20 128];
                step = 1/(n_val);
                L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','pchip');
                a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                s = s+n_val;
                
                % YELLOW to GREEN
                n_val = floor(N*3/32);
                Lab1 = [100 0 128];
                Lab2 = [75 -80 80];
                step = 1/(n_val);
                L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','pchip');
                a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                s = s+n_val;
                
                % GREEN to useWhite
                if (flag_use_white)
                    % nVal = floor(N * 2 / 32);
                    Lab1 = [75 -80 80];
                    Lab2 = [100 0 0];
                    step = 1/(center-s);
                    L(s:center) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:center) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:center) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = center;
                end
                
                % HALF BAR ------- ------- ------- ------- ------- ------- ------- -------
                
                % GREEN to BLUE
                if (~flag_use_white)
                    n_val = floor(N*3/32);
                    Lab1 = [75 -80 80];
                    Lab2 = [100 -80  0];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                end
                
                if flag_zero_center
                    N = 2*(n_col-center);
                end
                
                if N > 0
                    if (~flag_use_white)
                        n_val = floor(N*2/32);
                        Lab1 = [100 -80 0];
                        Lab2 = [80 40 -128];
                        step = 1/(n_val);
                        L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                        a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                        b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                        s = s+n_val;
                    end
                    % HALF BAR ------- ------- ------- ------- ------- ------- ------- -------
                    
                    if (flag_use_white)
                        % useWhite to BLUE
                        n_val = floor(N*2/32);
                        Lab1 = [100 0 0];
                        Lab2 = [80 40 -128];
                        step = 1/(n_val);
                        L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                        a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                        b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                        s = s+n_val;
                    end
                    
                    % BLUE to PINK
                    n_val = floor(N*3/32);
                    Lab1 = [80 40 -128];
                    Lab2 = [50 -80 -80];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                    
                    % BLUE to VIOLET
                    n_val = floor(N*4/32);
                    Lab1 = [50 -80 -80];
                    Lab2 = [0 100 -128];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                    
                    % BLUE to VIOLET
                    n_val = floor(N*4/32);
                    Lab1 = [0  100 -128];
                    Lab2 = [40 128 -128];
                    step = 1/(n_val);
                    L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                    s = s+n_val;
                    
                    % BLUE to VIOLET
                    %nVal = floor(N*4/32);
                    Lab1 = [40 128 -128];
                    Lab2 = [25 10 -20];
                    step = 1/(n_col-s);
                    L(s:end) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
                    a(s:end) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
                    b(s:end) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
                end
                
                %L = [[0:100/(nColors/2-1):100]' ; flipud([0:100/(nColors/2-1):100]')];
                %L = flipud([0:100/(nColors-1):100]');
                cmap = flipud(Cmap.strangeLab2RGB(L, a, b )./255);
            catch
                cmap = jet(n_col);
            end
        end       
        
        function cmap = linspaced(n_col)
            % linearly spaced colors to maximize distance
            %
            % INPUT
            %   n_col           number of colors (default 51)
            %
            % SYNTAX
            %   cmap = Cmap.linspaced(n_col)
            %
            if nargin == 0 || isempty(n_col)
                n_col = 256;
            end
            try
                cmap = linspecer(n_col, 'sequential');
            catch
                fprintf('WARNING: To use linspaced colormap you need to download\n         linspacer.m from http://bit.ly/linspacer\n         switching to "jet"');
                cmap = jet(n_col);
            end
        end
        
        function cmap = gat2(n_col)
            % gat2 colormap build as a MATLAB parula buth with a greyscale conversion for printing
            % 
            % INPUT
            %   n_col	number of colors
            %
            % SYNTAX
            %   cmap = Cmap.gat2(n_col)
            %
            
            if nargin < 1
                n_col = 255;
            end
            
            N = n_col;
            
            L = ones(n_col,1)*100;
            a = ones(n_col,1)*0;
            b = ones(n_col,1)*0;
            
            % RED     100  128  128
            % VIOLET  100  128 -128
            % GREEN     x -128  128
            % BLUE      x -128 -128
            
            n_val = floor(N/5);
            Lab1 = [96 -17 11];
            Lab2 = [86 11 80];
            step = 1/(n_val);
            L(1:1+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (0:step:1)','linear');
            a(1:1+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (0:step:1)','linear');
            b(1:1+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (0:step:1)','linear');
            s = 1+n_val;
            
            n_val = floor(N/5);
            Lab1 = Lab2;
            Lab2 = [72 -29 31];
            step = 1/(n_val+1);
            L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','phcip');
            a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            s = s+n_val;
            
            n_val = floor(N/5);
            Lab1 = Lab2;
            Lab2 = [58 -33 -21];
            step = 1/(n_val+1);
            L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','phcip');
            a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            s = s+n_val;
            
            n_val = floor(N/5);
            Lab1 = Lab2;
            Lab2 = [45 2 -60];
            step = 1/(n_val+1);
            L(s:s+n_val) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','phcip');
            a(s:s+n_val) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:s+n_val) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            s = s+n_val;
            
            Lab1 = Lab2;
            Lab2 = [10 27 -80];
            step = 1/(n_col-s+1);
            L(s:end) = interp1([0 1]', [Lab1(1) Lab2(1)], (step:step:1)','linear');
            a(s:end) = interp1([0 1]', [Lab1(2) Lab2(2)], (step:step:1)','linear');
            b(s:end) = interp1([0 1]', [Lab1(3) Lab2(3)], (step:step:1)','linear');
            
            %L = [[0:100/(nColors/2-1):100]' ; flipud([0:100/(nColors/2-1):100]')];
            %L = flipud([25:(100-25)/(nColors-1):100]');
            %step = 1 / (n_col - 1);
            %L(1:end) = interp1([0 1]', [L(1) L(end)], (0:step:1)','linear');
            cmap = flipud(Cmap.strangeLab2RGB(L, a, b )./255);
            for c = 1 : 3
                %first_nz = find(cmap(1:(s - 1), c) > 0, 1, 'first');
                id_map =  1 : size(L, 1);
                cmap(id_map, c) = Cmap.interp1LS(id_map, cmap(id_map, c), 7);
            end
            
            % Smooth luminosity of the map 
            % -> to have a regular grayscale
            w = (sum(cmap,2) ./ Cmap.interp1LS(1 : size(cmap, 1), sum(cmap,2), 2)');
            cmap = cmap ./ repmat(w, 1, 3);
            % rescale cmap if smoothing makes it > 1
            cmap = max(0, cmap ./ repmat(max(1, max(cmap)), size(cmap, 1), 1));
        end
          
        function cmap = adaptiveTerrain(clim, approximate_n_col)
            % Adaptive terrain (rescale the zero to separate land and sea)
            %
            % INPUT (non mandatory)
            %   clim                color limits ()e.g. clim = caxis();)
            %   approximate_n_col   approximate n. col
            %
            % SYNTAX
            %   Cmap.adaptiveTerrain(<clim>, <approximate_n_col>)
            if nargin < 1 || isempty(clim)
                try
                    clim = caxis(gca);
                catch
                    clim = [-1000 3500];
                end
            end
            if nargin < 2 || isempty(approximate_n_col)
                approximate_n_col = 1024;
            end
            approximate_n_col = round(approximate_n_col * 10/8);
            clim = clim / diff(clim); % normalize clim
            full_map = Cmap.get('terrain', approximate_n_col);
            terrain = full_map((end - round(approximate_n_col * 6.5/9)) : end, :);
            if clim(1) >= 0
                cmap = terrain;
            else                
                approximate_n_col = max(5,round((size(terrain, 1) / max(0.000001, clim(2)) * -min(0, clim(1))) * 10 / 1.6));
                full_map = Cmap.get('terrain', approximate_n_col);
                sea = full_map(1 : round(approximate_n_col * 1.6/10), :);
                cmap = [sea; terrain];
            end
        end
    end
    
