        function fh = showMap(map_set, n_col)
            % Display one of multiple colormaps
            %
            % INPUT
            %   map_set list colormap names (string cell array)
            %   n_col	number of colors
            %
            % SINTAX
            %   Cmap.showMiscellaneous(n_col)
            if nargin < 1 || isempty(map_set)
                map_set = Cmap.ALL_MAPS;
            end
            if nargin < 2
                n_col = [];
            end
            if ~iscell(map_set)
                map_set = {map_set};
            end
            fh = figure('Visible', 'off');
            % If it is not docked maximize the figure
            if strcmp(fh.WindowStyle, 'normal')
                set(fh, 'units','normalized', 'outerposition',[0 0 1 1]);
            end
            n_cm = numel(map_set);
            
            for m = 1 : n_cm
                ax_l(m) = subplot(n_cm, 2, (m - 1) * 2 + 1); %#ok<AGROW>
                cmap = Cmap.get(map_set{m}, n_col);
                cmap = reshape(cmap,1, numel(cmap) / 3, 3);
                image(cmap);
                ax_l(m).XTickLabel = []; %#ok<AGROW>
                ax_l(m).YTickLabel = []; %#ok<AGROW>
                ax_l(m).XTick = []; %#ok<AGROW>
                ax_l(m).YTick = []; %#ok<AGROW>
                ylabel(map_set{m}, 'FontWeight', 'Bold', 'Rotation',0, 'VerticalAlignment', 'middle', 'HorizontalAlignment', 'right', 'interpreter', 'none');
            end
            
            for m = 1 : n_cm
                ax_r(m) = subplot(n_cm, 2, m * 2); %#ok<AGROW>
                cmap = Cmap.get(map_set{m}, n_col);
                cmap = repmat(sum(reshape(cmap,1, numel(cmap) / 3, 3), 3) / 3, 1, 1, 3);
                image(cmap);
                ax_r(m).XTickLabel = []; %#ok<AGROW>
                ax_r(m).YTickLabel = []; %#ok<AGROW>
                ax_r(m).XTick = []; %#ok<AGROW>
                ax_r(m).YTick = []; %#ok<AGROW>
                ylabel([map_set{m} ' BW'], 'FontWeight', 'Bold', 'Rotation',0, 'VerticalAlignment', 'middle', 'HorizontalAlignment', 'right', 'interpreter', 'none');
            end
            
            for m = 1 : n_cm
                % linkaxes([ax_l(m) ax_r(m)], 'x');
            end
            fh.Visible = 'on';
        end
    end
    
    %% PUBLIC UTILITIES
    % ==================================================================================================================================================
    methods (Static)
        function [R, G, B] = Lab2RGB(L, a, b)
            %LAB2RGB Convert an image from CIELAB to RGB
            %
            % function [R, G, B] = Lab2RGB(L, a, b)
            % function [R, G, B] = Lab2RGB(I)
            % function I = Lab2RGB(...)
            %
            % Lab2RGB takes L, a, and b double matrices, or an M x N x 3 double
            % image, and returns an image in the RGB color space.  Values for L are in
            % the range [0,100] while a* and b* are roughly in the range [-110,110].
            % If 3 outputs are specified, the values will be returned as doubles in the
            % range [0,1], otherwise the values will be uint8s in the range [0,255].
            %
            % This transform is based on ITU-R Recommendation BT.709 using the D65
            % white point reference. The error in transforming RGB -> Lab -> RGB is
            % approximately 10^-5.
            %
            % See also RGB2LAB.
            % By Mark Ruzon from C code by Yossi Rubner, 23 September 1997.
            % Updated for MATLAB 5 28 January 1998.
            % Fixed a bug in conversion back to uint8 9 September 1999.
            % Updated for MATLAB 7 30 March 2009.
            if nargin == 1
                b = L(:,:,3);
                a = L(:,:,2);
                L = L(:,:,1);
            end
            % Thresholds
            T1 = 0.008856;
            T2 = 0.206893;
            [M, N] = size(L);
            s = M * N;
            L = reshape(L, 1, s);
            a = reshape(a, 1, s);
            b = reshape(b, 1, s);
            % Compute Y
            fY = ((L + 16) / 116) .^ 3;
            YT = fY > T1;
            fY = (~YT) .* (L / 903.3) + YT .* fY;
            Y = fY;
            % Alter fY slightly for further calculations
            fY = YT .* (fY .^ (1/3)) + (~YT) .* (7.787 .* fY + 16/116);
            % Compute X
            fX = a / 500 + fY;
            XT = fX > T2;
            X = (XT .* (fX .^ 3) + (~XT) .* ((fX - 16/116) / 7.787));
            % Compute Z
            fZ = fY - b / 200;
            ZT = fZ > T2;
            Z = (ZT .* (fZ .^ 3) + (~ZT) .* ((fZ - 16/116) / 7.787));
            % Normalize for D65 white point
            X = X * 0.950456;
            Z = Z * 1.088754;
            % XYZ to RGB
            MAT = [ 3.240479 -1.537150 -0.498535;
                -0.969256  1.875992  0.041556;
                0.055648 -0.204043  1.057311];
            RGB = max(min(MAT * [X; Y; Z], 1), 0);
            R = reshape(RGB(1,:), M, N);
            G = reshape(RGB(2,:), M, N);
            B = reshape(RGB(3,:), M, N);
            if nargout < 2
                R = uint8(round(cat(3,R,G,B) * 255));
            end
        end
        
        function [L, a, b] = RGB2Lab(R, G, B)
            %RGB2LAB Convert an image from RGB to CIELAB
            %
            % function [L, a, b] = RGB2Lab(R, G, B)
            % function [L, a, b] = RGB2Lab(I)
            % function I = RGB2Lab(...)
            %
            % RGB2Lab takes red, green, and blue matrices, or a single M x N x 3 image,
            % and returns an image in the CIELAB color space.  RGB values can be
            % either between 0 and 1 or between 0 and 255.  Values for L are in the
            % range [0,100] while a and b are roughly in the range [-110,110].  The
            % output is of type double.
            %
            % This transform is based on ITU-R Recommendation BT.709 using the D65
            % white point reference. The error in transforming RGB -> Lab -> RGB is
            % approximately 10^-5.
            %
            % See also LAB2RGB.
            % By Mark Ruzon from C code by Yossi Rubner, 23 September 1997.
            % Updated for MATLAB 5 28 January 1998.
            % Updated for MATLAB 7 30 March 2009.
            if nargin == 1
                B = double(R(:,:,3));
                G = double(R(:,:,2));
                R = double(R(:,:,1));
            end
            if max(max(R)) > 1.0 || max(max(G)) > 1.0 || max(max(B)) > 1.0
                R = double(R) / 255;
                G = double(G) / 255;
                B = double(B) / 255;
            end
            % Set a threshold
            T = 0.008856;
            [M, N] = size(R);
            s = M * N;
            RGB = [reshape(R,1,s); reshape(G,1,s); reshape(B,1,s)];
            % RGB to XYZ
            MAT = [0.412453 0.357580 0.180423;
                0.212671 0.715160 0.072169;
                0.019334 0.119193 0.950227];
            XYZ = MAT * RGB;
            % Normalize for D65 white point
            X = XYZ(1,:) / 0.950456;
            Y = XYZ(2,:);
            Z = XYZ(3,:) / 1.088754;
            XT = X > T;
            YT = Y > T;
            ZT = Z > T;
            Y3 = Y.^(1/3);
            fX = XT .* X.^(1/3) + (~XT) .* (7.787 .* X + 16/116);
            fY = YT .* Y3 + (~YT) .* (7.787 .* Y + 16/116);
            fZ = ZT .* Z.^(1/3) + (~ZT) .* (7.787 .* Z + 16/116);
            L = reshape(YT .* (116 * Y3 - 16.0) + (~YT) .* (903.3 * Y), M, N);
            a = reshape(500 * (fX - fY), M, N);
            b = reshape(200 * (fY - fZ), M, N);
            if nargout < 2
                L = cat(3,L,a,b);
            end
        end
    end

    %% PRIVATE UTILITIES
    % ==================================================================================================================================================
    methods (Static, Access = private)                
        function [r, g, b] = strangeLab2RGB(L, a, b)
            % Function to move from CIE 1976 Lab 2 RGB color space
            %
            % INPUT
            %   L, a, b     arrays of color coordinates in th Lab space
            %
            % OUTPUT
            %   r, g, b     arrays of primary color components
            %
            % SYNTAX
            %   [r, g, b] = Cmap.Lab2RGB(L, a, b)
            %   [rgb] = Cmap.Lab2RGB(L, a, b)
            
            y = ( L + 16 ) ./ 116;
            x = a ./ 500 + y;
            z = y - b ./ 200;
            
            pos = (x.^3 > 0.008856);
            x(pos) = x(pos).^3;
            x(~pos) = (x(~pos) - 16 / 116 ) ./ 7.787;

            pos = (y.^3 > 0.008856);
            y(pos) = y(pos).^3;
            y(~pos) = (y(~pos) - 16 / 116 ) ./ 7.787;
                        
            pos = (z.^3 > 0.008856);
            z(pos) = z(pos).^3;
            z(~pos) = (z(~pos) - 16 / 116 ) ./ 7.787;
            
            % Observer= 2?, Illuminant= D65
            ref_x =  95.047;
            ref_y = 100.000;
            ref_z = 108.883;
            
            X = ref_x .* x;
            Y = ref_y .* y;
            Z = ref_z .* z;
            
                                 % D65 white point
            x = X ./ 100;        % X from 0 to  95.0456
            y = Y ./ 100;        % Y from 0 to 100.0000
            z = Z ./ 100;        % Z from 0 to 108.8754
            
            r = x .*  3.240479 + y .* -1.537150 + z .* -0.498535;
            g = x .* -0.969256 + y .*  1.875992 + z .*  0.041556;
            b = x .*  0.055648 + y .* -0.204043 + z .*  1.057311;
            
            pos = ( r > 0.0031308 );
            r(pos) = 1.055 .* ( r(pos) .^ ( 1 / 2.4 ) ) - 0.055;
            r(~pos) = 12.92 .* r(~pos);
            
            pos = ( g > 0.0031308 );
            g(pos) = 1.055 .* ( g(pos) .^ ( 1 / 2.4 ) ) - 0.055;
            g(~pos) = 12.92 .* g(~pos);
            
            pos = ( b > 0.0031308 );
            b(pos) = 1.055 .* ( b(pos) .^ ( 1 / 2.4 ) ) - 0.055;
            b(~pos) = 12.92 .* b(~pos);
            
            r = max(0,min(r .* 255,255));
            g = max(0,min(g .* 255,255));
            b = max(0,min(b .* 255,255));
            
            if ((nargout == 1) || (nargout == 0))
                r = [r,g,b];
            end            
        end
        
        function y_out = interp1LS(x_in, y_in, degree, x_out)
            % Least squares interpolant of a 1D dataset
            % Copy of a function in Core_Utils here only
            % to make this Class independent from Core_Utils
            %
            % INPUT
            %   x_in    obs coordinte
            %   y_in    obs value
            %   degree  degree of the polynomial
            %   x_out   interpolation coordinate, if empty = x_in
            %
            % SYNTAX
            %   y_out = interp1LS(x_in, y_in, degree, <x_out = x_in>)
            
            if nargin < 4
                x_out = x_in;
            end
            
            if (min(size(y_in)) == 1)
                n = 1;
            else
                n = size(y_in, 2);
            end
            
            for c = 1 : n
                if size(y_in, 1) == 1
                    y_tmp = y_in';
                else
                    y_tmp = y_in(:, c);
                end
                id_ok = ~isnan(y_tmp(:)) & ~isnan(x_in(:));
                x_tmp = x_in(id_ok);
                y_tmp = y_tmp(id_ok);
                
                n_obs = numel(x_tmp);
                A = zeros(n_obs, degree + 1);
                A(:, 1) = ones(n_obs, 1);
                for d = 1 : degree
                    A(:, d + 1) = x_tmp .^ d;
                end
                
                if (nargin < 4) && numel(x_out) == numel(x_tmp)
                    A2 = A;
                else
                    n_out = numel(x_out);
                    A2 = zeros(n_out, degree + 1);
                    A2(:, 1) = ones(n_out, 1);
                    for d = 1 : degree
                        A2(:, d + 1) = x_out .^ d;
                    end
                end
                
                warning('off')
                if min(size(y_in)) == 1
                    y_out = A2 * ((A' * A) \ (A' * y_tmp(:)));
                    y_out = reshape(y_out, size(x_out, 1), size(x_out, 2));
                else
                    y_out(:,c) = A2 * ((A' * A + eye(size(A,2))) \ (A' * y_tmp(:)));
                end
                warning('on')
            end
        end
        
        function cmap = getMatPlotLibMaps(matplotlib_fig_path)
            % Import colormap from matplotlib PNG
            % (for internal use) 
            %
            % SYNTAX
            %   cmap = getMatPlotLibMaps(matplotlib_fig_path)
            
            if nargin == 0 || isempty(matplotlib_fig_path)
                matplotlib_fig_path = './obj/utils/colormaps';
            end
            cmap_files = dir(fullfile(matplotlib_fig_path, '*.png'));
            
            all_cmap = [];
            for id = 1 : numel(cmap_files)
                img = imread(fullfile(matplotlib_fig_path, cmap_files(id).name));
                
                % detector = sum(img, 3); detector(detector == 255*3) = 0; figure; plot(sum(detector))
                % Cmaps are from pixel 113 to 543
                id_x = 129 : 634;
                
                detector = sum(img(:, id_x, :), 3); detector(detector == 255*3) = 0; detector(1:21, :) = 0;
                start = find(diff(sum(detector,2) > 1e4) > 0);
                stop = find(diff(sum(detector,2) > 1e4) < 0);
                id_y = ceil(start + (stop - start) ./ 2);
                
                cmap = img(id_y, id_x, :);
                if isempty(all_cmap)
                    all_cmap = cmap;
                else
                    all_cmap = [all_cmap; cmap]; %#ok<AGROW>
                end
            end
            cmap = all_cmap;
            clc
            fprintf('%% Cmaps as imported from file:\n\n');
            str = '';
            for m = 1 : size(cmap, 1)
                for c = 1 : 3
                    str = sprintf('%s uint8(cumsum([%s])); ...\n', str, sprintf('%d ', [int16(cmap(m,1,c)) diff(int16(cmap(m,:,c)))]));
                end
            end
            fprintf('\nMPL_CMAP = reshape([%s]'', %d, %d, %d);\n', str, size(cmap, 2), size(cmap, 3), size(cmap, 1));
            figure; image(cmap);
        end        
    end
